import React from 'react';
import Card from './Card';

function CardList({ deck }) {
    if (deck.cards) {
        return (
            deck.cards.map((card) => (
                <div key={card.id}>
                    <Card card={card} deck={deck} />
                </div>
            ))
        )
    };
    return <p>There are no cards in this deck.</p>
};

export default CardList;
